import React, { useState} from 'react';
 import 'bootstrap/dist/css/bootstrap.min.css';

const Carouse = ({images}) =>{
    return (
        <Carousel>
            {/* { images.map(index =>( */}
                <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={images}
                            alt="First slide"
                            width={800} height={500}
                        />
                </Carousel.Item>         
            {/* ))
            } */}
        </Carousel>
    )
}
export default Carouse;
